INSERT INTO `yyg_content` VALUES (1,'admin',NULL,'2016-10-17 16:25:43',_binary '\0','admin',NULL,'2016-11-09 14:35:50',5,'<p style=\"padding: 0px; border: 0px currentColor; color: rgb(85, 85, 85); font-family: ; font-size: 14px; margin-top: 0px; margin-bottom: 0px;\" microsoft=\"\"><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; font-size: 10.5pt; font-weight: bold;\">一、什么是云购世界？</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; font-size: 10.5pt; font-weight: bold;\"></span></p><p style=\"padding: 0px; border: 0px currentColor; color: rgb(85, 85, 85); font-family: ; font-size: 14px; margin-top: 0px; margin-bottom: 0px;\" microsoft=\"\"><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; font-size: 10.5pt;\">云购世界，就是指</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; font-size: 10.5pt;\">会员每</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; font-size: 10.5pt;\">花费1元购买商品</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; font-size: 10.5pt;\">，</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; font-size: 10.5pt;\">就有机会获得一件</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; font-size: 10.5pt;\">商品</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; font-size: 10.5pt;\">。</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; font-size: 10.5pt;\">每件商品被平分成若干“等份&quot;，每份</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; font-size: 10.5pt;\">1元即1个夺宝币，同时获得对应一个号码。当一件商品所有等份即相应号码被分配完成后，</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; font-size: 10.5pt;\">根据预先制定的规则计算出一个幸运号码，持有该号码的</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; font-size: 10.5pt;\">会员</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; font-size: 10.5pt;\">，直接获得该</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; font-size: 10.5pt;\">商品</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; font-size: 10.5pt;\">。</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; font-size: 10.5pt;\"></span></p><p style=\"padding: 0px; border: 0px currentColor; color: rgb(85, 85, 85); font-family: ; font-size: 14px; margin-top: 0px; margin-bottom: 0px;\" microsoft=\"\"><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(68, 68, 68); font-size: 10.5pt; font-weight: bold;\">2、四步骤</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(68, 68, 68); font-size: 10.5pt; font-weight: bold;\"></span></p><p style=\"padding: 0px; border: 0px currentColor; color: rgb(85, 85, 85); font-family: ; font-size: 14px; margin-top: 0px; margin-bottom: 0px;\" microsoft=\"\"><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(68, 68, 68); font-size: 10.5pt;\">A、<span style=\"color: rgb(68, 68, 68); font-size: 14px;\">挑选心仪的商品 </span></span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(68, 68, 68); font-size: 10.5pt;\"></span></p><p style=\"padding: 0px; border: 0px currentColor; color: rgb(85, 85, 85); font-family: ; font-size: 14px; margin-top: 0px; margin-bottom: 0px;\" microsoft=\"\"><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(68, 68, 68); font-size: 10.5pt;\">B、安全支付</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(68, 68, 68); font-size: 10.5pt;\"></span></p><p style=\"padding: 0px; border: 0px currentColor; color: rgb(85, 85, 85); font-family: ; font-size: 14px; margin-top: 0px; margin-bottom: 0px;\" microsoft=\"\"><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(68, 68, 68); font-size: 10.5pt;\">C、等待天下掉馅饼 </span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(68, 68, 68); font-size: 10.5pt;\"></span></p><p style=\"padding: 0px; border: 0px currentColor; color: rgb(85, 85, 85); font-family: ; font-size: 14px; margin-top: 0px; margin-bottom: 0px;\" microsoft=\"\"><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(68, 68, 68); font-size: 10.5pt;\">D、分享晒单</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(68, 68, 68); font-size: 10.5pt;\"></span></p><p style=\"padding: 0px; border: 0px currentColor; color: rgb(85, 85, 85); font-family: ; font-size: 14px; margin-top: 0px; margin-bottom: 0px;\" microsoft=\"\"><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(102, 102, 102); font-size: 10.5pt;\">晒出您收到的商品实物图片甚至您的靓照，说出您的</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(102, 102, 102); font-size: 10.5pt;\">爱我拍购物</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(102, 102, 102); font-size: 10.5pt;\">心得，让大家一起分享您的快乐。在您收到商品后，您只需登录网站完成晒单，并通过审核，即可获得5积分</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(102, 102, 102); font-size: 10.5pt;\">。</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(102, 102, 102); font-size: 10.5pt;\"></span></p><p style=\"padding: 0px; border: 0px currentColor; color: rgb(85, 85, 85); font-family: ; font-size: 14px; margin-top: 0px; margin-bottom: 0px;\" microsoft=\"\"><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(68, 68, 68); font-size: 10.5pt; font-weight: bold;\">3、云购世界规则</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(68, 68, 68); font-size: 10.5pt; font-weight: bold;\"></span></p><p style=\"padding: 0px; border: 0px currentColor; color: rgb(85, 85, 85); font-family: ; font-size: 14px; margin-top: 0px; margin-bottom: 0px;\" microsoft=\"\"><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(51, 51, 51); font-size: 10.5pt;\">A、获得积分：</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(51, 51, 51); font-size: 10.5pt;\">用户花费1元购买商品</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(51, 51, 51); font-size: 10.5pt;\">，即可获赠1积分；</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(51, 51, 51); font-size: 10.5pt;\"></span></p><p style=\"padding: 0px; border: 0px currentColor; color: rgb(85, 85, 85); font-family: ; font-size: 14px; margin-top: 0px; margin-bottom: 0px;\" microsoft=\"\"><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(51, 51, 51); font-size: 10.5pt;\">B、挑选喜欢的商品：</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(51, 51, 51); font-size: 10.5pt;\">商品</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(51, 51, 51); font-size: 10.5pt;\">分配对应数量的号码，1元，可以获得其中1个号码（系统随机分配）；</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(51, 51, 51); font-size: 10.5pt;\"></span></p><p style=\"padding: 0px; border: 0px currentColor; color: rgb(85, 85, 85); font-family: ; font-size: 14px; margin-top: 0px; margin-bottom: 0px;\" microsoft=\"\"><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(51, 51, 51); font-size: 10.5pt;\">C、</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(51, 51, 51); font-size: 10.5pt;\">同一件商品可以购买多次或一次购买多份。</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(51, 51, 51); font-size: 10.5pt;\"></span></p><p style=\"padding: 0px; border: 0px currentColor; color: rgb(85, 85, 85); font-family: ; font-size: 14px; margin-top: 0px; margin-bottom: 0px;\" microsoft=\"\"><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(51, 51, 51); font-size: 10.5pt;\">D、获得商品：</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(51, 51, 51); font-size: 10.5pt;\">当所有号码都被分配完毕后，系统根据规则计算出1个幸运号码，持有该号码的用户，直接获得该奖品。</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(51, 51, 51); font-size: 10.5pt;\"></span></p><p style=\"padding: 0px; border: 0px currentColor; color: rgb(85, 85, 85); font-family: ; font-size: 14px; margin-top: 0px; margin-bottom: 0px;\" microsoft=\"\"><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(51, 51, 51); font-size: 10.5pt;\">F、</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(68, 68, 68); font-size: 10.5pt;\">中奖者需要在一周内</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(68, 68, 68); font-size: 10.5pt;\">领取</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(68, 68, 68); font-size: 10.5pt;\">，以中奖日期为准，在第七天的16:00为领取有最后期限，逾期取消</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(68, 68, 68); font-size: 10.5pt;\">中奖</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(68, 68, 68); font-size: 10.5pt;\">资格。例：2013.1.1中奖，则需要在2013.1.8 16:00之前</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(68, 68, 68); font-size: 10.5pt;\">领取</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(68, 68, 68); font-size: 10.5pt;\">。</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(51, 51, 51); font-size: 10.5pt;\"></span></p><p style=\"padding: 0px; border: 0px currentColor; color: rgb(85, 85, 85); font-family: ; font-size: 14px; margin-top: 0px; margin-bottom: 0px;\" microsoft=\"\"><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(68, 68, 68); font-size: 10.5pt; font-weight: bold;\">4、</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(68, 68, 68); font-size: 10.5pt; font-weight: bold;\">幸运号码计算规则</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(68, 68, 68); font-size: 10.5pt; font-weight: bold;\"></span></p><p style=\"padding: 0px; border: 0px currentColor; color: rgb(85, 85, 85); font-family: ; font-size: 14px; margin-top: 0px; margin-bottom: 0px;\" microsoft=\"\"><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(51, 51, 51); font-size: 10.5pt;\">A、</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(51, 51, 51); font-size: 10.5pt;\">商品</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(51, 51, 51); font-size: 10.5pt;\">的最后一个号码分配完毕后，将公示该分配时间点前本站全部奖品的最后50个参与时间；</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(51, 51, 51); font-size: 10.5pt;\"></span></p><p style=\"padding: 0px; border: 0px currentColor; color: rgb(85, 85, 85); font-family: ; font-size: 14px; margin-top: 0px; margin-bottom: 0px;\" microsoft=\"\"><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(51, 51, 51); font-size: 10.5pt;\">B、</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(51, 51, 51); font-size: 10.5pt;\">将这50个时间的数值进行求和（得出数值A）（每个时间按时、分、秒、毫秒的顺序组合，如20:15:25.362则为201525362）；</span><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(51, 51, 51); font-size: 10.5pt;\"></span></p><p style=\"padding: 0px; border: 0px currentColor; color: rgb(85, 85, 85); font-family: ; font-size: 14px; margin-top: 0px; margin-bottom: 0px;\" microsoft=\"\"><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(51, 51, 51); font-size: 10.5pt;\">C、</span><span style=\"color: rgb(51, 51, 51); font-size: 10.5pt;\">（数值A）除以该奖品总需人次得到的余数 + 原始数 10000001，得到最终幸运号码，拥有该幸运号码者，直接获得该奖品。</span></p><p style=\"padding: 0px; border: 0px currentColor; color: rgb(85, 85, 85); font-family: ; font-size: 14px; margin-top: 0px; margin-bottom: 0px;\" microsoft=\"\"><span style=\"margin: 0px; padding: 0px; border: 0px currentColor; color: rgb(51, 51, 51); font-size: 10.5pt;\"></span></p><p style=\"padding: 0px; border: 0px currentColor; color: rgb(85, 85, 85); font-family: ; font-size: 14px; margin-top: 0px; margin-bottom: 0px;\" microsoft=\"\"><br/></p>'),(2,'admin',NULL,'2016-10-18 14:17:23',_binary '\0','admin',NULL,'2016-10-18 14:28:29',1,'<h4 style=\"margin: 30px 0px 0px; padding: 0px; font-size: 14px; color: rgb(102, 102, 102); font-family: 微软雅黑, Arial; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);\">1、怎样查看我参与的商品有没有中奖？</h4><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, Arial; font-size: 14px; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);\">每件商品开奖结果公布之后，登录夺宝网，进入&quot;我的夺宝中心&quot;，在&quot;我中奖的夺宝&quot;中即可查询中奖情况。</p><h4 style=\"margin: 30px 0px 0px; padding: 0px; font-size: 14px; color: rgb(102, 102, 102); font-family: 微软雅黑, Arial; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);\">2、我获得了商品，我还需要支付其他费用吗？</h4><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, Arial; font-size: 14px; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);\">不需要支付其他任何费用。</p><h4 style=\"margin: 30px 0px 0px; padding: 0px; font-size: 14px; color: rgb(102, 102, 102); font-family: 微软雅黑, Arial; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);\">3、当我获得商品以后我该做什么？</h4><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, Arial; font-size: 14px; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);\">在您获得商品后您会收到站内信、短信和电子邮件的通知。在这之后，您必须在“我的夺宝中心&quot;正确填写、真实的收货地址，完善或确认您的个人信息。我们会在您获得商品后3个工作日内通过电话方式与您取得联系。</p><h4 style=\"margin: 30px 0px 0px; padding: 0px; font-size: 14px; color: rgb(102, 102, 102); font-family: 微软雅黑, Arial; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);\">4、夺宝网的商品是正品吗？怎么保证？</h4><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, Arial; font-size: 14px; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);\">夺宝网承诺，所有商品100%正品，可享受厂家所提供的全国联保服务，享受商品的保修、换货和退货的义务（国家三包政策）。</p><h4 style=\"margin: 30px 0px 0px; padding: 0px; font-size: 14px; color: rgb(102, 102, 102); font-family: 微软雅黑, Arial; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);\">5、如何晒单分享？</h4><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, Arial; font-size: 14px; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);\">在您收到商品后，登录夺宝网，进入&quot;我的夺宝中心&quot;，在“晒单分享&quot;区发布晒单信息，通过审核后，您还可获得1000福分奖励。在您成功晒单后，您的晒单会出现在网站“晒单分享&quot;区，与大家分享喜悦。</p><h4 style=\"margin: 30px 0px 0px; padding: 0px; font-size: 14px; color: rgb(102, 102, 102); font-family: 微软雅黑, Arial; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);\">6、我收到的商品可以换货或者退货吗？</h4><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, Arial; font-size: 14px; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);\">非质量问题，不在三包范围内，不给予退换货。</p><h4 style=\"margin: 30px 0px 0px; padding: 0px; font-size: 14px; color: rgb(102, 102, 102); font-family: 微软雅黑, Arial; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);\">7、参与云购世界需要注意什么？</h4><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, Arial; font-size: 14px; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);\">请务必正确填写真实有效的联系电话、收货地址以便在您中奖时能及时与您取得联系。</p><h4 style=\"margin: 30px 0px 0px; padding: 0px; font-size: 14px; color: rgb(102, 102, 102); font-family: 微软雅黑, Arial; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);\">8、网上银行充值未及时到帐怎么办？</h4><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, Arial; font-size: 14px; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);\">网上支付未及时到帐可能有以下几个原因造成：</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, Arial; font-size: 14px; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);\">第一，由于网速或者支付接口等问题，支付数据没有及时传送到支付系统造成的；</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, Arial; font-size: 14px; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);\">第二，网速过慢，数据传输超时，使银行后台支付信息不能成功对接，导致银行交易成功而支付后台显示失败；</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, Arial; font-size: 14px; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);\">第三，在网上支付如果使用某些防火墙软件，有时会屏蔽银行接口的弹出窗口，这时会造成在银行那边被扣费，但在我们网站上显示尚没支付。但请您放心，每天我们都会根据银行系统的帐务明细清单对前一天的订单进行逐笔核对，如遇问题订单，我们会做手工添加。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, Arial; font-size: 14px; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);\">&nbsp;</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, Arial; font-size: 14px; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);\">建议反馈</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑, Arial; font-size: 14px; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);\">如您对我们“帮助中心&quot;的说